import React, { useState, useEffect } from "react";

const Button = (props) => {
  const [click, setClick] = useState(0);

  useEffect(() => {
    document.title = "new text title ${click}";
  });

  return (
    <button onClick={() => setClick(click + 1)}>
      {props.aaa}
      {click}
    </button>
  );
};
Button.defaultProps = {
  aaa: "button ",
};
export default Button;
